  "text" : "\uC911\uAD6D\uC740 \uBB3C\uC744 \uAE30\uBC18\uC73C\uB85C \uD558\uB294 \uC6A9(\uBC40)\uC744 \uC0C1\uC9D5\uC73C\uB85C \uD558\uB294 \uBB38\uD654\uC785\uB2C8\uB2E4. \uC6B0\uB9AC \uB098\uB77C\uB294 \uBD88\uC744 \uAE30\uBC18\uC73C\uB85C \uD558\uB294 \uC0C8(\uBD09)\uC744 \uAE30\uBC18\uC73C\uB85C \uD558\uB294 \uBB38\uD654\uC785\uB2C8\uB2E4. \uC774\uAC83\uC744 \uAE30\uB3C5\uAD50\uC640 \uC5F0\uAD00\uC2DC\uD0A4\uB824\uB294 \uC5F0\uAD6C\uB3C4 \uC788\uC2B5\uB2C8\uB2E4. \uBC40\uC740 \uB2E4 \uC544\uC2E4\uAC70\uACE0.. \uC0C8\uB294 \uBE44\uB458\uAE30\uC838..",
