  "text" : "\uC6B0\uB9AC \uB098\uB77C\uB294 \uB0B4\uC77C\uC758 \uC21C \uC6B0\uB9AC\uB9D0\uC774 \uC5C6\uC2B5\uB2C8\uB2E4. \uC5B4\uC81C, \uBAA8\uB808, \uADF8\uC800\uAED8 \uB2E4 \uC788\uB294\uB370 \uC720\uB3C5 \uB0B4\uC77C\uB9CC \uC5C6\uC2B5\uB2C8\uB2E4. \uC774\uAC83\uC740 \uC544\uC9C1\uAE4C\uC9C0\uB3C4 \uBBF8\uC2A4\uD14C\uB9AC\uC785\uB2C8\uB2E4. \uC65C \uC5C6\uB294\uAC74\uC9C0..\uC5C6\uC5B4\uC9C4 \uAC83\uC778\uC9C0.. \uC54C\uAE38\uC774 \uC5C6\uC2B5\uB2C8\uB2E4.",
